import React, { Component } from 'react'

 class BlogContent extends Component {
    render() {
        // let val =this.props
        // console.log(val);
        console.log(this.props);

        return (
            <div>

                <h1>{this.props.title}</h1>
                <h2>{this.props.content}</h2>

            </div>
        )
    }
}

export default BlogContent
